VALUES ('3230890933530', 'Cordon de poulet spécial Vendée Globe', 'Viande de poulet traitée en salaison 53% : viande de poulet 25%, eau, peau de poulet, protéines de _soja_, amidon transformé de tapioca, dextrose, sel, arôme naturel.  Panure 27% : farine de _blé_, sel, levure, épices, arôme naturel.  Jambon de Vendée traité en salaison, cuit 10% : jambon de Vendée IGP sans couenne 5% (jambon de porc sel, eau de vie de vin, épices et plantes aromatiques, dextrose, sucre, arômes naturels, ferments, conservateur : nitrate de potassium), viande de dinde, eau, stabilisants : triphosphates, polyphosphates, sirop de glucose, protéines de _soja_, gélifiant : algues Euchema transformées, arômes naturels.  Fromage fondu 10% : _fromages_, eau, amidons modifiés, _beurre_, _lait_ écrémé en poudre, lactosérum (_lait_), sels de fonte : E330, E331, E452, gélifiant : E407. Huile de tournesol.', 'https://static.openfoodfacts.org/images/products/323/089/093/3530/front_fr.8.400.jpg', '16', '4.3', '16', '1.8', '', '10', '1.3', '0.511811023622047', '', '0');

