VALUES ('3235080008531', 'P\'tite Choucroute du jour', 'Ingrédients : choucroute cuisinée 56,8%: choucroute, bouillon (jus de cuisson, huile de tournesol, bière 1% (dont malt d’ORGE), arôme naturel, oignons), sel, antioxydant : acide ascorbique. knack d\'Alsace 14,9% : viande de porc*, eau, viande de bœuf*, gras de porc*, sel, plasma déshydraté, stabilisants : diphosphates  et triphosphates, dextrose, épices et extrait d\'épices, arômes naturels,antioxydants : acide ascorbique, ascorbate de sodium, conservateur : nitrite de sodium. Boyau naturel de mouton. Saucisse fumée d\'Alsace cuite 10,8% : viande de porc*, eau, sel, dextrose, épices et plantes aromatiques, stabilisants : diphosphates et triphosphates, antioxydant : acide ascorbique, sucre, conservateur : nitrite de sodium, arômes naturels, poireau. Boyau naturel de porc. Pomme de terre cuite 10,8% : pomme de terre, eau, sel. Poitrine fumée cuite 6,8% : poitrine de porc*, eau, sel, dextrose, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Fumé au bois de hêtre. Pourcentages exprimés sur le total de la choucroute garnie. * Origine UE. Présence éventuelle de moutarde, lait, oeuf, gluten et fruits à coque.', 'https://static.openfoodfacts.org/images/products/323/508/000/8531/front_fr.14.400.jpg', '9.4', '2.9', '3.3', '0.5', '1.8', '5.4', '1.3', '0.511811023622047', '', '0');

