VALUES ('3237550029244', 'Choucroute', 'Choucroute cuisinée 56 % : choucroute, jus de cuisson, graisse d\'oie 2 %, Riesling 1 %, sel, arôme, baies de genièvre, antioxydant : acide ascorbique. Pommes de terre cuites 14 % : pommes de terre, eau, sel. Knacks 11% : viande de porc*, eau, viande de bœuf*, gras de porc*, sel, plasma déshydraté, stabilisants : diphosphates et triphosphates, épices et extrait d\'épices, arômes naturels, antioxydants : acide ascorbique, ascorbate de sodium, conservateur : nitrite de sodium - Boyau naturel de mouton. Saucisses fumées cuites 8% : viande de porc*, eau, sel, dextrose, épices et plantes aromatiques, stabilisants : diphosphates et triphosphates, antioxydant : acide ascorbique, sucre, conservateur : nitrite de sodium, arômes naturels, poireau - Boyau naturel de porc. Filet de porc fumé cuit 6 % : filet de porc, eau, sel, dextrose, stabilisants : diphosphates et triphosphates, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Poitrine de porc fumée cuite 5 % : poitrine de porc fumée cuite*, eau, sel, dextrose, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Fumé au bois de hêtre. Pourcentages exprimés sur le total de la choucroute garnie. *Origine UE', 'https://static.openfoodfacts.org/images/products/323/755/002/9244/front_fr.3.400.jpg', '8.4', '3.2', '4', '0.5', '1.7', '5.4', '1.2', '0.47244094488189', '', '0');

